        uint256 _initialSupply,
        address _systemAddress,
        address _treasuryAddress
    ) internal {
        cosmonuts = new CosmoNuts(COSMOS_NAME, COSMOS_SYMBOL, _initialSupply, _systemAddress, _treasuryAddress);
        cosmosAddress = address(cosmonuts);
    }
    */

}
